import React from "react";

export default function InfoTooltip() {
    return(
        <section className="signup-confirmation" id="popup-signup">
            <div className="signup-confirmation__container">
                <img className="signup-confirmation__success" src="/" alt="/"/>
                <p className="signup-confirmation__success-message"></p>
                <img className="signup-confirmation__fail" src="/" alt="/"/>
                <p className="signup-confirmation__fail-message"></p>
            </div>
        </section>
    )
}
